import React from "react";
import NavBar from "../UI/Header/Navbar/Navbar";
import Jumbotron from "../UI/Header/Jumbotron/Jumbotron";
const Layout = ({ children }) => {
  return (
    <React.Fragment>
      <NavBar />
      <Jumbotron />
      {children}
      <p>Footer</p>
    </React.Fragment>
  );
};

export default Layout;
